import React from "react";

function LoginPage() {
  return (
    <div className="LoginPage">
      <h1>Login</h1>
      <div>
        <input type="text" placeholder="email" />
        <input type="password" placeholder="password" />
        <button>Login</button>
      </div>
    </div>
  );
}

export default LoginPage;
